import React from 'react';
import { useLocation } from "react-router-dom";
export default function Register() {
        const location=useLocation();
        // setFname(resp[params.id - 1].Fname)
        // setLname(resp[params.id - 1].Lname)
        // setFather_name(resp[params.id - 1].Father_Name)
        // setMother_name(resp[params.id - 1].Mother_Name)
        // setDob(resp[params.id - 1].DOB)
        // setC_code(resp[params.id - 1].Country_code)
        // setContact(resp[params.id - 1].Contact)
        // setGender(resp[params.id - 1].Gender)
        // setEmail(resp[params.id - 1].Email)
        // setPassword(resp[params.id - 1].Password)
        // setAddress1(resp[params.id - 1].Address_1)
        // setAddress2(resp[params.id - 1].Address_2)
        // setCity(resp[params.id - 1].City)
        // setState(resp[params.id - 1].State)
        // setPincode(resp[params.id - 1].Pincode)
    return(
    <div>
        <form className="row m-5 pl-5 pr-5 pb-5">
        <p className="h1 text-center p-4">Registration form</p>
        <div className="col-md-6">
          <label htmlFor="First Name" className="form-label">First Name</label>
          <input type="text" name="fname" className="form-control" id="First Name" placeholder="First name" value={location.state.fname} readonly/>
        </div>

        <div className="col-md-6">
          <label htmlFor="Last Name" className="form-label">Last Name</label>
          <input type="text" name="lname" className="form-control" id="Last Name" placeholder="Last Name" value={location.state.lname} readonly/>
        </div>
        <div className="col-md-12">
          <label htmlFor="Father Name" className="form-label">Father Name</label>
          <input type="text" name="father_name" className="form-control" id="Father Name" placeholder='Father Name' value={location.state.father_name} readonly/>
        </div>
        <div className="col-md-6">
          <label htmlFor="Mother Name" className="form-label">Mother Name</label>
          <input type="text" name="mother_name" className="form-control" id="Mother Name" placeholder='Mother Name' value={location.state.mother_name} readonly/>
        </div>
        <div className="col-md-6">
          <label htmlFor="dob" className="form-label">Date Of Birth</label>
          <input type="date" name="dob" className="form-control" id="dob" value={location.state.dob} readonly/>
        </div>
        <div className="col-md-3">
          <label htmlFor="Country Code" className="form-label">Country Code</label>
          <select id="Country Code" name="country_code" className="form-select" value={location.state.c_code} readonly>
            <option value="NULL">Country Code</option>
            <option value="+91(India)">+91(India)</option>
            <option value="+61(Australia)">+61(Australia)</option>
            <option value="+880(Bangladesh)">+880(Bangladesh)</option>
          </select>
        </div>
        <div className="col-md-4">
          <label htmlFor="Contact No" className="form-label">Contact No</label>
          <input type="number" name="contact" className="form-control" id="Contact No" maxLength={10} placeholder='Ex- 1234567890' value={location.state.contact} readonly/>
        </div>
        <div className="radio col-md-5 mt-1">
          <label htmlFor="Gender" className="form-label">Gender</label><br />
          <div className="form-check form-check-inline">
            <input className="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="Male" readonly/>
            <label className="form-check-label" htmlFor="inlineRadio1" >Male</label>
          </div>
          <div className="form-check form-check-inline">
            <input className="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="Female"  readonly/>
            <label className="form-check-label" htmlFor="inlineRadio1">Female</label>
          </div>
          <div className="form-check form-check-inline">
            <input className="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="Others" readonly/>
            <label className="form-check-label" htmlFor="inlineRadio1">Others</label>
          </div>
        </div>
        <div className="col-md-6">
          <label htmlFor="inputEmail" className="form-label">Email</label>
          <input type="email" className="form-control" id="inputEmail" placeholder='example@gmail.com' required readonly/>
        </div>
        <div className="col-md-6">
          <label htmlFor="inputPassword" className="form-label">Password</label>
          <input type="password" className="form-control" id="inputPassword" placeholder='Ex- Ab123@' onChange={(event) => {
            setPassword(event.target.value);
          }} required readonly/>
        </div>
        <div className="col-12">
          <label htmlFor="inputAddress" className="form-label">Address</label>
          <input type="text" className="form-control" id="inputAddress" placeholder="House/Flat/Room No/Village" onChange={(event) => {
            setAddress1(event.target.value);
          }} required readonly/>
        </div>
        <div className="col-12">
          <label htmlFor="inputAddress2" className="form-label">Address 2</label>
          <input type="text" className="form-control" id="inputAddress2" placeholder="Apartment/floor/Street/LandMark" onChange={(event) => {
            setAddress2(event.target.value);
          }} readonly/>
        </div>
        <div className="col-md-6">
          <label htmlFor="inputCity" className="form-label">City</label>
          <input type="text" className="form-control" id="inputCity" placeholder='Ex: Kolkata' onChange={(event) => {
            setCity(event.target.value);
          }} required readonly/>
        </div>
        <div className="col-md-4">
          <label htmlFor="inputState" className="form-label">State</label>
          <select id="inputState" className="form-select" onChange={(event) => {
            setState(event.target.value);
          }} required readonly>
            <option value="NULL">Select State</option>
            <option value="Andhra Pradesh">Andhra Pradesh</option>
            <option value="Assam">Assam</option>
            <option value="Bihar">Bihar</option>
            <option value="Maharashtra">Maharashtra</option>
            <option value="Sikkim">Sikkim</option>
            <option value="Odisha">Odisha</option>
            <option value="West Bengal">West Bengal</option>
          </select>
        </div>
        <div className="col-md-2">
          <label htmlFor="pincode" className="form-label">Pincode</label>
          <input type="number" inputMode='numeric' maxLength="6" className="form-control" id="pincode" onChange={(event) => {
            setPincode(event.target.value);
          }} required />
        </div>
        <div className="col-12">
          <div className="form-check">
            <input className="form-check-input" type="checkbox" id="gridCheck" required />
            <label className="form-check-label" htmlFor="gridCheck">
              I agree all terms and Conditions.
            </label>
          </div>
        </div>
        {/* <div action="/upload" encType="multipart/form-data" method="post">
          <div className="form-group">
            <input type="file" className="form-control-file" name="uploaded_file" />
            {/* <input type="text" className="form-control" placeholder="Number of speakers" name="nspeakers" /> */}
            {/* <button type="submit" value="Get me the stats!" className="btn btn-default" >Upload</button> */}
          {/* </div> */}
        {/* </div> */} 

        <div className="col-lg-2 d-flex align-items-end p-3">
          <button type="submit" className='btn btn-outline-success btn-block p-2 m-2' onClick={addStudent}>Save</button>
        </div>
      </form>
    </div>
    )
